def convert(array):
	Remember = []
	for line in array:
		if line:
			line = (int(line) - (((70 + 23.0) + 458.0) - (64 + 438.0)))
			Remember.append(int(line))

	RememberTwo = []
	for line in Remember:
		newline = chr(int(line))
		RememberTwo.append(newline)
	return RememberTwo

